import './App.css';
import DisplayHeader from './components/atm-header';
import DisplayScreen from './components/atm-screen';
import { ThemeProvider, createTheme, Box, Grid2 } from '@mui/material';

const theme = createTheme({
  components: {
    MuiContainer: {
      defaultProps: {
        background: 'red',
        height: 'lg',
        width: 'lg', // or 'md', 'sm', 'xl'
      },
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Grid2 container>
      <DisplayHeader />
      <DisplayScreen />
      </Grid2>
    </ThemeProvider>
  );
}

